import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Ni en pedo piba, estoy programando.
          <br/>
          Si necesitas te puedo ofrecer 1066 pe para el uber.
        </p>
        <PropiedadHome />
      </header>
    </div>
  );
}

export default App;
